const formMetadata = formData => {
  let data = {
    table: {
      dontBreakRows: true,
      widths: ["50%", "50%"],
      body: [[[{
        text: "Criado a: ",
        style: "formData"
      }, {
        text: formData.dtaCriada,
        style: "formData"
      }],
      [{
        text: "Estado: ",
        style: "formData"
      }, {
        text: formData.estado,
        style: "formData"
      }], ]]
    },
    layout: {
      hLineWidth: function (i, node) {
        return 0.5;
      },
      vLineWidth: function (i, node) {
        return 0.5;
      },
      hLineColor: function (i, node) {
        return "black";
      },
      vLineColor: function (i, node) {
        return "black";
      }
    }
  };
  return data;
};

export { formMetadata };
